import { useEffect, useState } from "react";

//components
import StockDetails from '../components/StockDetails'

const Home = function() {

    

    return (
        <div className="home">
            <div className="stocks">
                {stocks && stocks.map((stock) => (
                    <StockDetails key={stock._id} stock={stock}/>
                ))}
            </div>
        </div>
    )
}
export default Home;
